import React from 'react'
import { useSelector } from 'react-redux'

export default function AllNotes() {
  const notes = useSelector((state) => state.notes)
  return (
    <div>
      {
        notes.map(note => {
          return (
            <div>
              <div>{notes.title}</div>
              <div>{notes.content} </div>
            </div>

          )
        })
      }
    </div>
  )
}
